"use strict";

function f_gold(firstList, secondList) {
    let i = 0, j = 0;
    let ans = [];
    while (i < firstList.length && j < secondList.length) {
        let [s1, e1] = firstList[i];
        let [s2, e2] = secondList[j];
        let l = Math.max(s1, s2);
        let r = Math.min(e1, e2);
        if (l <= r) {
            ans.push([l, r]);
        }
        if (e1 < e2) {
            i += 1;
        } else {
            j += 1;
        }
    }
    return ans;
}
